ng of XSL stylesheet w/XML output\nMISC:\n  -6: Enable IPv6 scanning\n  -A: Enable OS detection, version detection, script scanning, and traceroute\n  --datadir <dirname>: Specify custom Nmap data file location\n  --send-eth/--send-ip: Send using raw ethernet frames or IP packets\n  --privileged: Assume that the user is fully privileged\n  --unprivileged: Assume the user lacks raw socket privileges\n  -V: Print version number\n  -h: Print this help summary page.\nEXAMPLES:\n  nmap -v -A scanme.nmap.org\n  nmap -v -sn 192.168.0.0/16 10.0.0.0/8\n  nmap -v -iR 10000 -Pn -p 80\nSEE THE MAN PAGE (http://nmap.org/book/man.html) FOR MORE OPTIONS AND EXAMPLES\n',NULL,NULL,'completed','2016-04-25 20:31:22'),(18,'mojtaba_amiri@hotmail.co.uk','nmap -sV pengui.uk','\nStarting Nmap 6.47 ( http://nmap.org ) at 2016-04-25 21:42 BST\nNmap scan report for pengui.uk (188.166.25.11)\nHost is up (0.046s latency).\nNot shown: 996 closed ports\nPORT    STATE SERVICE VERSION\n22/tcp  open  ssh     OpenSSH 6.7p1 Debian 5+deb8u2 (protocol 2.0)\n80/tcp  open  http    nginx 1.6.2\n111/tcp open  rpcbind 2-4 (RPC #100000)\n443/tcp open  http    nginx 1.6.2\nService Info: OS: Linux; CPE: cpe:/o:linux:linux_kernel\n\nService detection performed. Please report any incorrect results at http://nmap.org/submit/ .\nNmap done: 1 IP address (1 host up) scanned in 9.46 seconds\n',NULL,NULL,'completed','2016-04-25 20:42:18'),(19,'mojtaba_amiri@hotmail.co.uk','nmap -sV pengui.uk','\nStarting Nmap 6.47 ( http://nmap.org ) at 2016-04-25 21:42 BST\nNmap scan report for pengui.uk (188.166.25.11)\nHost is up (0.072s latency).\nNot shown: 996 closed ports\nPORT    STATE SERVICE VERSION\n22/tcp  open  ssh     OpenSSH 6.7p1 Debian 5+deb8u2 (protocol 2.0)\n80/tcp  open  http    nginx 1.6.2\n111/tcp open  rpcbind 2-4 (RPC #100000)\n443/tcp open  http    nginx 1.6.2\nService Info: OS: Linux; CPE: cpe:/o:linux:linux_kernel\n\nService detection performed. Please report any incorrect results at http://nmap.org/submit/ .